import React, { useEffect, useState } from 'react';
import { fetchTopRoutes } from '../api';
import useQuerySql from '../hooks/useQuerySql';

function TopRoutesTables() {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [showPg, setShowPg] = useState(false);
  const [showMonet, setShowMonet] = useState(false);
  const sqls = useQuerySql('topRoutes');

  useEffect(() => {
    fetchTopRoutes()
      .then(r => setData(r))
      .catch(e => setError(e.message || String(e)))
      .finally(() => setLoading(false));
  }, []);

  const columns = ['Origen','Destino','Tickets','Revenue (USD)'];

  const render = (engine, label) => {
    if (!data || !data[engine] || !Array.isArray(data[engine].result)) return null;
    let rows = data[engine].result;
    if (engine === 'monet') rows = rows.map(a => ({ origin: a[0], dest: a[1], tickets: a[2], revenue: a[3] }));
    const isShown = engine === 'pg' ? showPg : showMonet;
    const toggle = () => engine === 'pg' ? setShowPg(s=>!s) : setShowMonet(s=>!s);
    return (
      <div className="col-md-6 mb-4">
        <div className="card shadow h-100">
          <div className={`card-header ${engine==='pg'?'bg-info':'bg-warning'} text-white text-center`}>
            <h4 className="mb-0">{label}</h4>
          </div>
          <div className="card-body p-0">
            <div style={{ maxHeight:420, overflowY:'auto' }}>
              <table className="table table-bordered table-striped align-middle text-center mb-0">
                <thead className="table-light" style={{ position:'sticky', top:0, zIndex:1 }}>
                  <tr>{columns.map(c=> <th key={c}>{c}</th>)}</tr>
                </thead>
                <tbody>
                  {rows.map((r,i)=>(
                    <tr key={i}>
                      <td>{r.origin}</td>
                      <td>{r.dest}</td>
                      <td>{r.tickets}</td>
                      <td>{r.revenue != null ? Number(r.revenue).toFixed(2) : '—'}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>

            <div className="p-2">
              <button className="btn btn-sm btn-outline-secondary" onClick={toggle}>
                {isShown ? 'Ocultar SQL' : 'Mostrar SQL'}
              </button>
              <div style={{ display: isShown ? 'block' : 'none', marginTop:10, background:'#f8f9fa', padding:12, border:'1px solid #e9ecef', borderRadius:4 }}>
                <pre style={{ whiteSpace:'pre-wrap', margin:0, fontSize:13 }}>{sqls ? (engine==='pg'?sqls.pg:sqls.monet) : ''}</pre>
              </div>
            </div>

          </div>
        </div>
      </div>
    );
  };

  return (
    <section className="container my-4">
      <div className="row">
        {loading ? <div className="col-12 text-center py-4"><div className="spinner-border text-info" role="status"/><p> Cargando...</p></div>
         : error ? <div className="col-12 alert alert-danger text-center">Error: {error}</div>
         : !data ? <div className="col-12 alert alert-warning text-center">No hay datos</div>
         : <>
             {render('pg','PostgreSQL - Rutas Top')}
             {render('monet','MonetDB - Rutas Top')}
           </>}
      </div>
    </section>
  );
}

export default TopRoutesTables;
